class vec3 {
	constructor(x, y, z) { this.x = x; this.y = y; this.z = z; }
	set(v) { this.x = v.x; this.y = v.y; this.z = v.z; return this; }
	clone() { return new vec3(this.x, this.y, this.z); }
	xy() { return new vec3(this.x, this.y, 0.0); }
	xz() { return new vec3(this.x, 0.0, this.z); }
	yz() { return new vec3(0.0, this.y, this.z); }
	neg() { this.x = -this.x; this.y = -this.y; this.z = -this.z; return this; }
	add(v) { this.x += v.x; this.y += v.y; this.z += v.z; return this; }
	sub(v) { this.x -= v.x; this.y -= v.y; this.z -= v.z; return this; }
	scale(f) { this.x *= f; this.y *= f; this.z *= f; return this; }
	dot(v) { return this.x * v.x + this.y * v.y + this.z * v.z; }
	cross(v) {
		let x = this.y * v.z - v.y * this.z;
		let y = this.z * v.x - v.z * this.x;
		let z = this.x * v.y - v.x * this.y;
		this.x = x; this.y = y; this.z = z; return this;
	}
	normalize() { return this.scale(1.0 / Math.max(0.00000001, Math.sqrt(this.dot(this)))); }
}

class Shader {
	static compileShader(gl, shaderSource, shaderType) {
		let shader = gl.createShader(shaderType);
		gl.shaderSource(shader, shaderSource);
		gl.compileShader(shader);
		let success = gl.getShaderParameter(shader, gl.COMPILE_STATUS);
		if (!success) {
			throw 'Could not compile shader:'+gl.getShaderInfoLog(shader);
		}
		return shader;
	}

	static createProgram(gl, vertexShader, fragmentShader) {
		let program = gl.createProgram();
		gl.attachShader(program, vertexShader);
		gl.attachShader(program, fragmentShader);
		gl.linkProgram(program);
		let success = gl.getProgramParameter(program, gl.LINK_STATUS);
		if (!success) {
			throw ('Program filed to link:'+gl.getProgramInfoLog(program));
		}
		return program;
	}
}

class Gfx {
	constructor(parentElement) {
		this.canvas = document.createElement('canvas');
		this.canvas.style = 'width: 256px; height: 256px; image-rendering: -moz-crisp-edges; image-rendering: pixelated;'
		parentElement.appendChild(this.canvas);
		gl = this.canvas.getContext('webgl', {
			alpha: false,
			depth: true,
			// desynchronized: true,
			// preserveDrawingBuffer: true,
			// antialias: Boolean that indicates whether or not to perform anti-aliasing.
		});
		this.OES_element_index_uint = gl.getExtension('OES_element_index_uint');
		if (!this.OES_element_index_uint) {
			console.error('OES_element_index_uint extension is required, but not supported by this platform');
		}
		this.ANGLE_instanced_arrays = gl.getExtension('ANGLE_instanced_arrays');
		if (!this.ANGLE_instanced_arrays) {
			console.error('ANGLE_instanced_arrays extension is required, but not supported by this platform');
		}
		gl.ANGLE_instanced_arrays = this.ANGLE_instanced_arrays;

		this.viewportWidth = 100.0;
		this.viewportHeight = 100.0;
		this.ppi = 96.0;
	}

	resize() {
		let canvas = this.canvas;
		let w = canvas.clientWidth;
		let h = w;//canvas.parentElement.clientHeight;
		this.viewportWidth = 256;//Math.floor(w * window.devicePixelRatio);
		this.viewportHeight = 256;//Math.floor(h * window.devicePixelRatio);
		this.ppi = 96.0 * window.devicePixelRatio * (w / this.viewportWidth);
		canvas.width = this.viewportWidth;
		canvas.height = this.viewportHeight;
	}

	render() {
		gl.viewport(0, 0, this.viewportWidth, this.viewportHeight);
		gl.clearColor(0.0, 0.0, 0.0, 1.0);
		gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);

		gl.enable(gl.DEPTH_TEST);
	}
}

class GlobalShaderUniforms {
	constructor() {
		this.uniforms = [];
		this.bindingHash = 0;
	}

	register(name, type, data) {
		this.uniforms.push({name, type, data});
		++this.bindingHash;
	}
}
