const kGrassCellDim = 12;

class Grass {
	constructor(gl) {
		const vertSrc = `
		#version 100
		uniform mat4 viewFromWorld;
		uniform mat4 projFromView;
		uniform vec3 eye;
		uniform vec2 viewport;

		uniform float lightning;

		uniform float time;

		attribute vec2 a_uv;
		attribute vec3 a_pos;
		attribute vec3 a_dir;
		attribute vec4 a_dims;
		attribute vec3 a_color;
		varying vec2 v_uv;
		varying vec2 v_dims;
		varying vec3 v_color;




		float hash(vec3 p) { // replace this by something better
			p  = fract( p*0.3183099+.1 );
			p *= 17.0;
			return fract( p.x*p.y*p.z*(p.x+p.y+p.z) );
		}
		float noise(vec3 x) {
			vec3 i = floor(x);
			vec3 f = fract(x);
			f = f*f*(3.0-2.0*f);

			return mix(mix(mix( hash(i+vec3(0,0,0)), 
								hash(i+vec3(1,0,0)),f.x),
							mix( hash(i+vec3(0,1,0)), 
								hash(i+vec3(1,1,0)),f.x),f.y),
						mix(mix( hash(i+vec3(0,0,1)), 
								hash(i+vec3(1,0,1)),f.x),
							mix( hash(i+vec3(0,1,1)), 
								hash(i+vec3(1,1,1)),f.x),f.y),f.z);
		}
		const mat3 m = mat3( 0.00,  0.80,  0.60,
			-0.80,  0.36, -0.48,
			-0.60, -0.48,  0.64 );
		float fbm(vec3 pos) {
			vec3 q = 8.0*pos;
			float f = 0.0;
            f += 0.5000*noise( q ); q = m*q*2.01;
            f += 0.2500*noise( q ); q = m*q*2.02;
            f += 0.1250*noise( q ); q = m*q*2.03;
            f += 0.0625*noise( q ); q = m*q*2.01;
			return f;
		}




		void main() {
			v_uv = a_uv;
			v_dims = a_dims.xy;
			v_color = a_color;

			// Push away from the eye
			vec2 EtoX = a_pos.xz - eye.xz;
			float eDist = length(EtoX);
			vec2 forward2d = -vec2(viewFromWorld[0][2], viewFromWorld[2][2]);
			EtoX += -0.925 * forward2d * dot(forward2d, EtoX);
			vec2 pushXZ = normalize(EtoX) * 0.5 * max(0.0, 1.25 - eDist);
			vec3 dir = normalize(a_dir + vec3(pushXZ.x, 0.0, pushXZ.y));


			// Very expensive wind!
			const float kWind = 0.0075;
			dir.x += kWind * dir.y * a_dims.y * (fbm(vec3(0.095 * a_pos.xz, 0.1 * (time - 0.2 * a_uv.y))) - 0.5);
			dir.z += kWind * dir.y * a_dims.y * (fbm(vec3(0.095 * a_pos.xz, 0.1 * (time - 0.2 * a_uv.y) + 20.0)) - 0.5);
			dir = normalize(dir);


			vec3 right = vec3(viewFromWorld[0][0], viewFromWorld[1][0], viewFromWorld[2][0]);
			vec3 X = a_pos;
			// Prevent the blades from getting thinner than a pixel
			if (false) {
				vec3 camZ = vec3(viewFromWorld[0][2], viewFromWorld[1][2], viewFromWorld[2][2]);
				float z = dot(camZ, X - eye);
				float height = -2.0 * z / projFromView[1][1];
				float pixel = height / viewport.y;
				X += (a_uv.x - 0.5) * max(2.0 * pixel, a_dims.x) * right;
			} else {
				X += (a_uv.x - 0.5) * a_dims.x * right;
			}
			if (true) {
				dir = normalize(mix(vec3(0.0, 1.0, 0.0), dir, 0.5 + 0.5 * a_uv.y));
				X += a_uv.y * a_dims.y * dir;
			} else { // Alternate bend equation where blade length is held constant (good for gravity, but doesn't model wind that well)
				float t = a_uv.y;
				vec3 d0 = normalize(mix(vec3(0.0, 1.0, 0.0), dir, 0.5));
				vec3 d1 = dir;
				float C = 1.0 - dot(d0, d1);
				float scale =  0.1366 * C*C*C + -0.2028 * C*C + 0.3137 * C + 0.9788;
				X += scale * a_dims.y * (d0 * t + 0.5 * (d1 - d0) * t * t);
			}


			vec3 L = eye - vec3(0.0, 0.5, 0.0);
			float Ldenom = distance(X, L) / 0.05 + 1.0;
			float eyeLight = 400.0 / (Ldenom * Ldenom);
			eyeLight *= mix(dir.y, 0.5 + 0.5 * dot(normalize(X - L), dir), 0.333);

			float lightningLamb = max(0.0, 0.2 + 0.8 * dot(dir, vec3(0.9,0.1,0.1)));
			float lightningLight = lightningLamb * lightningLamb * lightningLamb * (0.25 + a_uv.y) * lightning * max(0.0, 12.0-distance(X, L));

			v_color *= eyeLight + lightningLight;

			gl_Position = projFromView * viewFromWorld * vec4(X, 1.0);
		}
		`;
		const fragSrc = `
			#version 100
			precision highp float;
			varying highp vec2 v_uv;
			varying highp vec2 v_dims;
			varying highp vec3 v_color;
			void main() {
				float bottomDim = clamp(0.05 + 0.95 * v_uv.y, 0.0, 1.0);
				vec3 color = bottomDim * v_color;

				vec3 x = clamp(color.rgb - 0.004, 0.0, 64.0);
				vec3 filmicColor = (x * (6.2 * x + 0.5)) / (x * (6.2 * x + 1.7) + 0.06);
				gl_FragData[0] = vec4(filmicColor, 1.0);
			}
		`;
		this.vertShader = Shader.compileShader(gl, vertSrc, gl.VERTEX_SHADER);
		this.fragShader = Shader.compileShader(gl, fragSrc, gl.FRAGMENT_SHADER);
		this.program = Shader.createProgram(gl, this.vertShader, this.fragShader);
		this.attributes = {
			uv: gl.getAttribLocation(this.program, 'a_uv'),
			pos: gl.getAttribLocation(this.program, 'a_pos'),
			dir: gl.getAttribLocation(this.program, 'a_dir'),
			dims: gl.getAttribLocation(this.program, 'a_dims'),
			color: gl.getAttribLocation(this.program, 'a_color'),
		};
		this.globalShaderUniformBindings = new GlobalShaderUniformBindings(this.program);

		this.grassVertBufSize = 8 * 8;
		this.grassIdxBufSize = 2 * 3 * 6;
		this.grassInstBufSize = 44 * 65536;
		const grassVertData = new Float32Array([
			0.0, 0.0, 0.0, 0.25, 0.0, 0.5, 0.0, 1.0,
			1.0, 0.0, 1.0, 0.5, 1.0, 0.75, 1.0, 1.0]);
		const grassIdxData = new Uint16Array([
			0, 4, 5, 5, 1, 0,
			1, 5, 6, 6, 2, 1,
			2, 6, 7, 7, 3, 2]);
		this.grassVertBuf = gl.createBuffer();
		gl.bindBuffer(gl.ARRAY_BUFFER, this.grassVertBuf);
		gl.bufferData(gl.ARRAY_BUFFER, grassVertData, gl.STATIC_DRAW);
		this.grassIdxBuf = gl.createBuffer();
		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.grassIdxBuf);
		gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, grassIdxData, gl.STATIC_DRAW);
		this.grassInstBufs = [];
		for (let i = 0; i < 3; i++) {
			this.grassInstBufs[i] = gl.createBuffer();
			gl.bindBuffer(gl.ARRAY_BUFFER, this.grassInstBufs[i]);
			gl.bufferData(gl.ARRAY_BUFFER, this.grassInstBufSize, gl.DYNAMIC_DRAW);
		}
		this.bufferIdx = 2; // Keeps track of which of our triple buffered buffer we're actually using

		this.grassCount = 0;

		const kCells = (2 * kGrassCellDim + 1) * (2 * kGrassCellDim + 1);
		this.bladesPerCell = 40;
		this.cells = [new Array(kCells), new Array(kCells)];
		this.cellCenter = { x: 0, z: 0 };
		for (let z = 0; z <= 2 * kGrassCellDim; z++) {
			for (let x = 0; x <= 2 * kGrassCellDim; x++) {
				let grassInstData = new ArrayBuffer(this.bladesPerCell * 44);
				this.generateCell(x - kGrassCellDim, z - kGrassCellDim, this.bladesPerCell, grassInstData);
				this.cells[0][x + (2 * kGrassCellDim + 1) * z] = { grassInstData, valid: true };
			}
		}
	}

	generateCell(x, z, bladeCount, grassInstData) {
		let idx = (x + 320) + 640 * (z + 320);

		function Random(seed) { this._seed = (seed + 2147483647) % 2147483647; }
		Random.prototype.next = function() { return this._seed = this._seed * 16807 % 2147483647; };
		Random.prototype.random = function() { return (this.next() - 1) / 2147483646; };
		Random.prototype.rr = function(min, max) { return min + (max - min) * this.random(); };
		let rng = new Random(idx);

		function sample(x, y) {
			let ix = Math.floor(kTerrainScale * x + kTerrainDim / 2 + rng.rr(-0.85, 0.85));
			let iy = Math.floor(kTerrainScale * y + kTerrainDim / 2 + rng.rr(-0.85, 0.85));
			ix = ((ix % kTerrainDim) + kTerrainDim) % kTerrainDim;
			iy = ((iy % kTerrainDim) + kTerrainDim) % kTerrainDim;
			let t = kTerrain[ix + iy * kTerrainDim] * (1.0 / 255.0);
			return Math.max(0.0, Math.min(1.0, 2.0 * (t - 0.05) + 0.05));
		}

		for (let i = 0; i < bladeCount; i++) {
			let t = new vec3(x + rng.random(), 0.0, z + rng.random());
			let knocked = sample(t.x, t.z);
			let bend = (new vec3(rng.rr(-1.0, 1.0), 0.0, rng.rr(-1.0, 1.0))).normalize().scale(rng.rr(0.25, 1.0));
			let d = new vec3(bend.x, 4.0, bend.z);
			let standing = knocked;
			standing *= standing * standing;
			standing *= standing * standing;
			standing *= standing * standing;
			standing *= standing * standing;
			d.y -= 3.95 * (standing);
			d.normalize();
			let w = rng.rr(0.025, 0.075)*1.5*(1.0-(knocked - 0.25*standing));
			let h = rng.rr(3.0 - 2.0 * knocked * knocked, 4.0 - 2.0 * knocked * knocked);
			(new Float32Array(grassInstData, i * 44, 10)).set([
				t.x, t.y, t.z,
				d.x, d.y, d.z,
				w, h, 0.0, 0.0]);
			(new Uint8Array(grassInstData, i * 44 + 40, 4)).set([20+(rng.next()%64), 160 - 80*standing, 5, 255]);
		}
	}

	updateCellCenter(camera) {
		let cx = Math.floor(camera.pos.x);
		let cz = Math.floor(camera.pos.z);
		if (this.cellCenter.x == cx && this.cellCenter.z == cz) { return; }
		console.log("Updating Cell Center:", "Old: ", this.cellCenter, "New: ", { cx, cz });
		const kFullDim = 2 * kGrassCellDim + 1;
		for (let z = 0; z < kFullDim; z++) {
			for (let x = 0; x < kFullDim; x++) {
				let ox = x + cx - this.cellCenter.x;
				let oz = z + cz - this.cellCenter.z;
				let mx = ((ox % kFullDim) + kFullDim) % kFullDim;
				let mz = ((oz % kFullDim) + kFullDim) % kFullDim;
				this.cells[1][x + kFullDim * z] = this.cells[0][mx + kFullDim * mz];
				this.cells[1][x + kFullDim * z].valid = ox == mx && oz == mz;
			}
		}
		let tempCells = this.cells[0];
		this.cells[0] = this.cells[1];
		this.cells[1] = tempCells;
		this.cellCenter.x = cx;
		this.cellCenter.z = cz;
	}

	update(gl, camera) {
		this.updateCellCenter(camera);

		let genCount = 0;
		let maxGen = 6;
		this.grassCount = 0;
		gl.bindBuffer(gl.ARRAY_BUFFER, this.grassInstBufs[this.bufferIdx]);
		const kFullDim = 2 * kGrassCellDim + 1;
		for (let z = 0; z < kFullDim; z++) {
			for (let x = 0; x < kFullDim; x++) {
				let cell = this.cells[0][x + kFullDim * z];
				if (!cell.valid) {
					if (genCount < maxGen) {
						this.generateCell(
							this.cellCenter.x + x - kGrassCellDim, this.cellCenter.z + z - kGrassCellDim,
							this.bladesPerCell, cell.grassInstData);
						cell.valid = true;
						++genCount;
					} else {
						continue;
					}
				}
				if ((x - kGrassCellDim) * camera.z.x + (z - kGrassCellDim) * camera.z.z > 1.0) { continue; }
				gl.bufferSubData(gl.ARRAY_BUFFER, this.grassCount * 44, cell.grassInstData);
				this.grassCount += this.bladesPerCell;
			}
		}
	}

	render(gl) {
		gl.useProgram(this.program);
		gl.enableVertexAttribArray(this.attributes.uv);
		gl.enableVertexAttribArray(this.attributes.pos);
		gl.enableVertexAttribArray(this.attributes.dir);
		gl.enableVertexAttribArray(this.attributes.dims);
		gl.enableVertexAttribArray(this.attributes.color);
		this.globalShaderUniformBindings.bind(gl);

		gl.bindBuffer(gl.ARRAY_BUFFER, this.grassVertBuf);
		gl.vertexAttribPointer(this.attributes.uv, 2, gl.FLOAT, false, 8, 0);
		gl.bindBuffer(gl.ARRAY_BUFFER, this.grassInstBufs[this.bufferIdx]);
		gl.vertexAttribPointer(this.attributes.pos, 3, gl.FLOAT, false, 44, 0);
		gl.vertexAttribPointer(this.attributes.dir, 3, gl.FLOAT, false, 44, 12);
		gl.vertexAttribPointer(this.attributes.dims, 4, gl.FLOAT, false, 44, 24);
		gl.vertexAttribPointer(this.attributes.color, 4, gl.UNSIGNED_BYTE, true, 44, 40);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.pos, 1);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dir, 1);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dims, 1);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.color, 1);

		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.grassIdxBuf);
		gl.ANGLE_instanced_arrays.drawElementsInstancedANGLE(gl.TRIANGLES, 3 * 6, gl.UNSIGNED_SHORT, 0, this.grassCount);

		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.pos, 0);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dir, 0);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dims, 0);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.color, 0);
		gl.disableVertexAttribArray(this.attributes.uv);
		gl.disableVertexAttribArray(this.attributes.pos);
		gl.disableVertexAttribArray(this.attributes.dir);
		gl.disableVertexAttribArray(this.attributes.dims);
		gl.disableVertexAttribArray(this.attributes.color);
		this.globalShaderUniformBindings.unbind(gl);

		this.bufferIdx = this.bufferIdx < 2 ? this.bufferIdx + 1 : 0;
	}
}

const SpriteId = {
	'eye': { bounds: [0,0, 40,43] },
	'ghost': { bounds: [40,0, 34,59] },
	'skull': { bounds: [0,43, 40,45] },
	'skull_small': { bounds: [40,58, 22,24] },
	'hand_push_grass': { bounds: [74,0, 16,27] },
};

class Sprites {
	constructor(gl) {
		const vertSrc = `
		#version 100
		uniform mat4 viewFromWorld;
		uniform mat4 projFromView;
		uniform vec3 eye;

		uniform float lightning;

		uniform float time;

		attribute vec2 a_uv;
		attribute vec2 a_pixel;
		attribute vec4 a_color;
		attribute vec3 a_pos;
		attribute vec3 a_dir;
		attribute vec2 a_dims;
		varying vec3 v_color;

		float rand(float co) { return fract(sin(co*(91.3458)) * 47453.5453); }
		float rand(vec2 co){ return fract(sin(dot(co.xy ,vec2(12.9898,78.233))) * 43758.5453); }
		float rand(vec3 co){ return rand(co.xy+rand(co.z)); }

		void main() {
			v_color = a_color.rgb * a_color.rgb;
			vec3 dir = a_dir;

			vec3 right = vec3(viewFromWorld[0][0], viewFromWorld[1][0], viewFromWorld[2][0]);
			vec3 X = a_pos;
			X += a_uv.x * a_dims.x * right;
			X += a_uv.y * a_dims.y * dir;

			// Explosion effect!
			/*
			float r0 = rand(a_pixel.x);
			float r1 = rand(r0);
			float r2 = rand(r1);
			float r3 = rand(r1);
			vec3 V0 = (normalize(vec3(r0, r1 + 0.4, r2) - 0.5) * r3) * vec3(2.0, 6.0, 2.0);
			float t = max(0.0, 6.5 * fract(1.0/6.5 * time) - 0.5);
			float y0 = X.y;
			const float G = -5.0;
			const float Bounce = 0.625;
			float tB1 = (-V0.y - sqrt(V0.y * V0.y - 2.0 * G * y0)) / G;
			float t1 = t - tB1;
			float V1y = -Bounce * (V0.y + tB1 * G);
			float tB2 = tB1 - 2.0 * V1y / G;
			float t2 = t - tB2;
			float V2y = Bounce * V1y;
			float tB3 = tB2 - 2.0 * V2y / G;
			float t3 = t - tB3;

			X.x += V0.x * min(t, tB3);
			X.y = t1 < 0.0
				? (y0 + V0.y * t + 0.5 * G * t * t)
				: t2 < 0.0
					? (V1y * t1 + 0.5 * G * t1 * t1)
					: t3 < 0.0 ? (V2y * t2 + 0.5 * G * t2 * t2) : 0.0;
			X.z += V0.z * min(t, tB3);
			*/


			vec3 L = eye - vec3(0.0, 0.5, 0.0);
			float Ldenom = distance(X, L) / 0.05 + 1.0;
			float light = 400.0 / (Ldenom * Ldenom);
			light *= mix(dir.y, 0.5 + 0.5 * dot(normalize(X - L), dir), 0.333);

			float lightningLight = 0.01 * max(0.0, 0.5 + (0.015 * a_uv.y)) * lightning * max(0.0, 12.0-distance(X, L));

			v_color *= (light + lightningLight);
			v_color += vec3(0.02 * lightningLight);

			gl_Position = projFromView * viewFromWorld * vec4(X, 1.0);
		}
		`;
		const fragSrc = `
			#version 100
			precision highp float;
			varying vec3 v_color;
			void main() {
				vec3 color = v_color;

				vec3 x = clamp(color.rgb - 0.004, 0.0, 64.0);
				vec3 filmicColor = (x * (6.2 * x + 0.5)) / (x * (6.2 * x + 1.7) + 0.06);
				gl_FragData[0] = vec4(filmicColor, 1.0);
			}
		`;
		this.vertShader = Shader.compileShader(gl, vertSrc, gl.VERTEX_SHADER);
		this.fragShader = Shader.compileShader(gl, fragSrc, gl.FRAGMENT_SHADER);
		this.program = Shader.createProgram(gl, this.vertShader, this.fragShader);
		this.attributes = {
			uv: gl.getAttribLocation(this.program, 'a_uv'),
			pixel: gl.getAttribLocation(this.program, 'a_pixel'),
			color: gl.getAttribLocation(this.program, 'a_color'),
			pos: gl.getAttribLocation(this.program, 'a_pos'),
			dir: gl.getAttribLocation(this.program, 'a_dir'),
			dims: gl.getAttribLocation(this.program, 'a_dims'),
		};
		this.globalShaderUniformBindings = new GlobalShaderUniformBindings(this.program);

		this.instBufSize = 32 * 2048;
		this.vertBuf = gl.createBuffer();
		this.idxBuf = gl.createBuffer();
		this.instBufs = [];
		for (let i = 0; i < 3; i++) {
			this.instBufs[i] = gl.createBuffer();
			gl.bindBuffer(gl.ARRAY_BUFFER, this.instBufs[i]);
			gl.bufferData(gl.ARRAY_BUFFER, this.instBufSize, gl.DYNAMIC_DRAW);
		}
		this.bufferIdx = 2; // Keeps track of which of our triple buffered buffer we're actually using

		this.spriteDescriptors = {};

		this.sprites = [];
		this.spriteCount = 0;

		this.loaded = false;

		// Load the source texture
		let image = new Image();
		image.onload = () => {
			// Read the pixel data the only way possible in HTML: via canvas!
			let canvas = document.createElement('canvas');
			canvas.width = image.naturalWidth;
			canvas.height = image.naturalHeight;
			let ctx = canvas.getContext('2d');
			ctx.drawImage(image, 0, 0);
			let pxls = ctx.getImageData(0, 0, image.naturalWidth, image.naturalHeight).data;

			// Extract data from the image for each of the sprites in the sprite list
			let totalVerts = 0;
			let totalIdxs = 0;
			for (let [id, createDesc] of Object.entries(SpriteId)) {
				let x0 = createDesc.bounds[0];
				let y0 = createDesc.bounds[1];
				let x1 = createDesc.bounds[0] + createDesc.bounds[2];
				let y1 = createDesc.bounds[1] + createDesc.bounds[3];
				let xc = createDesc.bounds[0] + Math.floor(createDesc.bounds[2] / 2);
				let yc = createDesc.bounds[1] + Math.floor(createDesc.bounds[3] / 2);

				let desc = { vertOffset: 0, vertCount: 0, idxOffset: 0, idxCount: 0 };

				// Do a first pass to count filled pixels so we know how much buffer space we need
				desc.vertCount = 0;
				for (let y = y0; y < y1; y++) {
					for (let x = x0; x < x1; x++) {
						let i = x + y * image.naturalWidth;
						let bg = pxls[4 * i + 0] == 255 && pxls[4 * i + 1] == 0 && pxls[4 * i + 2] == 255;
						if (!bg) { desc.vertCount += 4; }
					}
				}

				// Copy the pixel data into the vert buffers
				desc.verts = new ArrayBuffer(12 * desc.vertCount);
				let pos = new Int16Array(desc.verts);
				let color = new Uint8Array(desc.verts);
				desc.idxs = new Uint32Array(desc.vertCount / 4 * 6);
				desc.vertCount = 0;
				desc.idxCount = 0;
				let addVert = (x, y, i, r, g, b, a) => {
					pos[6 * desc.vertCount + 0] = x - xc;
					pos[6 * desc.vertCount + 1] = yc - y;
					pos[6 * desc.vertCount + 2] = i;
					pos[6 * desc.vertCount + 3] = i;
					color[12 * desc.vertCount + 8] = r;
					color[12 * desc.vertCount + 9] = g;
					color[12 * desc.vertCount + 10] = b;
					color[12 * desc.vertCount + 11] = a;
					++desc.vertCount;
				}
				for (let y = y0; y < y1; y++) {
					for (let x = x0; x < x1; x++) {
						let i = x + y * image.naturalWidth;
						let bg = pxls[4 * i + 0] == 255 && pxls[4 * i + 1] == 0 && pxls[4 * i + 2] == 255;
						if (!bg) {
							let pixelId = desc.vertCount / 4;
							addVert((x + 0), (y + 0), pixelId, pxls[4 * i + 0], pxls[4 * i + 1], pxls[4 * i + 2], pxls[4 * i + 3]);
							addVert((x + 1), (y + 0), pixelId, pxls[4 * i + 0], pxls[4 * i + 1], pxls[4 * i + 2], pxls[4 * i + 3]);
							addVert((x + 1), (y + 1), pixelId, pxls[4 * i + 0], pxls[4 * i + 1], pxls[4 * i + 2], pxls[4 * i + 3]);
							addVert((x + 0), (y + 1), pixelId, pxls[4 * i + 0], pxls[4 * i + 1], pxls[4 * i + 2], pxls[4 * i + 3]);
							desc.idxs[desc.idxCount++] = desc.vertCount - 4;
							desc.idxs[desc.idxCount++] = desc.vertCount - 3;
							desc.idxs[desc.idxCount++] = desc.vertCount - 2;
							desc.idxs[desc.idxCount++] = desc.vertCount - 2;
							desc.idxs[desc.idxCount++] = desc.vertCount - 1;
							desc.idxs[desc.idxCount++] = desc.vertCount - 4;
						}
					}
				}

				this.spriteDescriptors[id] = desc;

				totalVerts += desc.vertCount;
				totalIdxs += desc.idxCount;
			}

			// Fill the GL buffers
			gl.bindBuffer(gl.ARRAY_BUFFER, this.vertBuf);
			gl.bufferData(gl.ARRAY_BUFFER, 12 * totalVerts, gl.STATIC_DRAW);
			gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.idxBuf);
			gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, 4 * totalIdxs, gl.STATIC_DRAW);
			let vertOffset = 0;
			let idxOffset = 0;
			for (let [id, desc] of Object.entries(this.spriteDescriptors)) {
				for (let i = 0; i < desc.idxs.length; i++) {
					desc.idxs[i] += vertOffset;
				}
				gl.bufferSubData(gl.ARRAY_BUFFER, 12 * vertOffset, desc.verts);
				gl.bufferSubData(gl.ELEMENT_ARRAY_BUFFER, 4 * idxOffset, desc.idxs);
				desc.vertOffset = 12 * vertOffset;
				desc.idxOffset = 4 * idxOffset;
				vertOffset += desc.vertCount;
				idxOffset += desc.idxCount;
			}

			this.loaded = true;
		};
		image.src = `junk/sprites.png?r=${Math.random()}`;
	}

	addSprite(id, x, y, z, scaleX, scaleY) {
		if (!this.loaded) { return; }

		scaleX = scaleX || 1.0;
		scaleY = scaleY || 1.0;

		this.sprites[this.spriteCount] = this.spriteDescriptors[id];
		gl.bindBuffer(gl.ARRAY_BUFFER, this.instBufs[this.bufferIdx]);
		let inst = new Float32Array([
			x, y, z,
			0.0, 1.0, 0.0,
			scaleX * 0.05, scaleY * 0.05,
		]);
		gl.bufferSubData(gl.ARRAY_BUFFER, 32 * this.spriteCount, inst);
		++this.spriteCount;
	}

	update(gl, camera) {
		if (!this.loaded) { return; }
	}

	render(gl) {
		if (!this.loaded) { return; }

		gl.useProgram(this.program);
		gl.enableVertexAttribArray(this.attributes.uv);
		gl.enableVertexAttribArray(this.attributes.pixel);
		gl.enableVertexAttribArray(this.attributes.color);
		gl.enableVertexAttribArray(this.attributes.pos);
		gl.enableVertexAttribArray(this.attributes.dir);
		gl.enableVertexAttribArray(this.attributes.dims);
		this.globalShaderUniformBindings.bind(gl);

		gl.bindBuffer(gl.ARRAY_BUFFER, this.vertBuf);
		gl.vertexAttribPointer(this.attributes.uv, 2, gl.SHORT, false, 12, 0);
		gl.vertexAttribPointer(this.attributes.pixel, 2, gl.UNSIGNED_SHORT, false, 12, 4);
		gl.vertexAttribPointer(this.attributes.color, 4, gl.UNSIGNED_BYTE, true, 12, 8);
		gl.bindBuffer(gl.ARRAY_BUFFER, this.instBufs[this.bufferIdx]);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.pos, 1);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dir, 1);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dims, 1);
		gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, this.idxBuf);
		for (let i = 0; i < this.spriteCount; i++) {
			let desc = this.sprites[i];
			gl.vertexAttribPointer(this.attributes.pos, 3, gl.FLOAT, false, 32, i * 32 + 0);
			gl.vertexAttribPointer(this.attributes.dir, 3, gl.FLOAT, false, 32, i * 32 + 12);
			gl.vertexAttribPointer(this.attributes.dims, 2, gl.FLOAT, false, 32, i * 32 + 24);
			gl.ANGLE_instanced_arrays.drawElementsInstancedANGLE(gl.TRIANGLES, desc.idxCount, gl.UNSIGNED_INT, desc.idxOffset, 1);
		}
		this.spriteCount = 0;

		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.pos, 0);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dir, 0);
		gl.ANGLE_instanced_arrays.vertexAttribDivisorANGLE(this.attributes.dims, 0);
		gl.disableVertexAttribArray(this.attributes.uv);
		gl.disableVertexAttribArray(this.attributes.pixel);
		gl.disableVertexAttribArray(this.attributes.color);
		gl.disableVertexAttribArray(this.attributes.pos);
		gl.disableVertexAttribArray(this.attributes.dir);
		gl.disableVertexAttribArray(this.attributes.dims);
		this.globalShaderUniformBindings.unbind(gl);

		this.bufferIdx = this.bufferIdx < 2 ? this.bufferIdx + 1 : 0;
	}
}

//-----------------------------------------------------------------------------
// Update loop
let timestampOld = 0.0;
let timeUniform = new Float32Array(1);
function update(timestamp) {
	let dt = Math.min(0.05, 0.001 * (timestamp - timestampOld));
	timestampOld = timestamp;
	timeUniform[0] = 0.001 * timestamp;

	avatar.update(dt, camera);
	let camPos = avatar.pos.clone().add(new vec3(0.0, 1.5, 0.0));
	camera.update(camPos, avatar.dir, new vec3(0.0, 1.0, 0.0), 90.0, gfx.viewportWidth, gfx.viewportHeight);
	globalCameraUniforms.update(camera, gfx.viewportWidth, gfx.viewportHeight);
	avatar.updateLate(dt, camera);

	envNode.update(dt);
	grass.update(gl, camera);
	sprites.update(gl, camera);

	sprites.addSprite('eye', -3.0, 1.0, 0.0);
	sprites.addSprite('ghost', -3.0, 2.0, -2.0);
	sprites.addSprite('ghost', -4.0, 1.75, -2.2);
	sprites.addSprite('ghost', -2.0, 1.75, -2.4);
	sprites.addSprite('skull', -0.75, 1.0, 2.0);
	sprites.addSprite('skull_small', -2.5, 0.5, 2.0);

	gfx.render();
	grass.render(gl);
	sprites.render(gl);
	envNode.render(gl);

	window.requestAnimationFrame(update);
}

